          <div className='user-top-profile-image-box'></div>
          <div className='user-top-info-box'>
                  <div className='user-top-info-nickname-box'>
                    <div className='user-top-info-nickname'></div>
                    <div></div>
                  </div>
                  <div className='user-top-info-email'></div>
          </div>
    </div>
  </div>
)

}


// component: 유저화면 하단 컴포넌트 
const UserBottom=()=>{

  // render: 유저화면  히딘 컴포넌트 렌더링 
  return(
    <div></div>
  )

  }










// render: 유저화면 컴포넌트 렌더링 
  return (
    <>
      <UserTop/>
      <UserBottom/>
    </>
  )
}
